import React from "react";
import {ModalFooter, Nav, Navbar} from "react-bootstrap";

const Foother = () => {
    return(
        <ModalFooter>
            <Navbar.Collapse className="justify-content-end">
                <Nav className='button-header Button-text-1'>
                    <Nav.Link className='Home-header' href='/'><b>Головна</b></Nav.Link>
                    <Nav.Link className='Procidure-header' href='/'><b>Процедурні кабінети</b></Nav.Link>
                    <Nav.Link className='Shedule-header' href='/'><b>Розклад</b></Nav.Link>
                </Nav>
                <button className='button-login Button-text-1'>Увійти</button>
            </Navbar.Collapse>
        </ModalFooter>
    )
}
export default Foother;
